		private static async void Checkuuid()
		{
			if (Program.lblCountdown != null && Program.mainForm != null && !Program.mainForm.IsDisposed)
			{
				await Task.Delay(1000);

				if (Program.mainForm.InvokeRequired)
				{
					Program.mainForm.Invoke(new Action(Checkuuid));
					return;
				}

				string current_uuid_plain = AuthCheck.GetMachineUUID();
				CustomerRecord customer = null;
				try
				{
					customer = await FetchOrCreateCustomerAsync(current_uuid_plain);
				}
				catch (Exception ex)
				{
					Debug.WriteLine("FetchOrCreateCustomerAsync failed: " + ex.Message);
				}

				if (customer == null)
				{
					Program.ShowFatalMessageAndExit(
						"ไม่สามารถเชื่อมต่อไปยังเซิร์ฟเวอร์ยืนยันสิทธิ์ได้ในขณะนี้\nโปรแกรมจะปิดอัตโนมัติภายใน 3 วินาที",
						"Connection Error",
						MessageBoxIcon.Error,
						null
					);
					return;
				}

				bool isMember = string.Equals(customer.plan, "member", StringComparison.OrdinalIgnoreCase);
				bool isFree = string.Equals(customer.plan, "free", StringComparison.OrdinalIgnoreCase);
				bool enabled = customer.status;

				if (!enabled)
				{
					ShowUnauthorizedAndExit(current_uuid_plain);
					return;
				}

				if (isMember)
				{
					string memberName = string.IsNullOrWhiteSpace(customer.name) ? "ไม่ระบุ" : customer.name;
					Program.isTrialMode = false;
					Program.trialExpirationHandled = false;
					firebaseExpiry = null;
					Program.lblCountdown.Text = $"สถานะโปรแกรม : ได้รับอนุญาต (สมาชิก : {memberName})";
					Program.lblCountdown.ForeColor = Color.Green;
					if (Program.lblCountdown1 != null)
					{
						Program.lblCountdown1.Text = string.Empty;
					}
					Program.SetUiAuthLoading(false);
					return;
				}

				// free: ต้องเช็ควันหมดอายุกับสถานะเปิดใช้งาน
				if (isFree)
				{
					DateTime expiryUtc;
					DateTimeOffset expiryOffset;
					if (!DateTimeOffset.TryParse(customer.expiry, CultureInfo.InvariantCulture, DateTimeStyles.AdjustToUniversal | DateTimeStyles.AssumeUniversal, out expiryOffset))
					{
						Program.ShowFatalMessageAndExit(
							"รูปแบบวันหมดอายุไม่ถูกต้อง",
							"Error",
							MessageBoxIcon.Error,
							null
						);
						return;
					}

					expiryUtc = expiryOffset.UtcDateTime;
					firebaseExpiry = expiryUtc;
					Program.isTrialMode = true;
					Program.trialExpirationHandled = false;
					Program.trialStartTime = DateTime.Now;
					Program.lblCountdown.Text = "สถานะโปรแกรม : Free (ตรวจวันหมดอายุ)";
					Program.lblCountdown.ForeColor = Color.DarkGreen;
					if (Program.lblCountdown1 != null)
					{
						Program.lblCountdown1.Text = string.Empty;
					}
					Program.SetUiAuthLoading(false);
					return;
				}

				// แผนอื่นถือว่าไม่รองรับ
				Program.ShowFatalMessageAndExit(
					"รูปแบบแผนใช้งานไม่รองรับ",
					"Error",
					MessageBoxIcon.Error,
					null
				);
			}
		}

