		private static void ForceCloseApplication()
		{
			Action exitAction = delegate
			{
				Program.ScheduleSelfDeleteIfNeeded();
				try
				{
					Application.Exit();
				}
				catch
				{
				}
				Environment.Exit(0);
			};
			if (Program.mainForm != null && !Program.mainForm.IsDisposed)
			{
				try
				{
					Program.mainForm.BeginInvoke(exitAction);
					return;
				}
				catch
				{
				}
			}
			exitAction();
		}

