		private static void CheckHotkeys()
		{
			if (Program.mainForm == null || Program.mainForm.IsDisposed)
			{
				return;
			}
			bool f4Down = ((int)Program.GetAsyncKeyState((int)Program.VK_F4) & 32768) != 0;
			if (f4Down && !Program.isF4Held)
			{
				Program.CycleShootingMode();
			}
