		private static void UpdateCountdown()
		{
			if (Program.lblCountdown1 != null && Program.mainForm != null && !Program.mainForm.IsDisposed)
			{
				if (Program.mainForm.InvokeRequired)
				{
					Program.mainForm.Invoke(new Action(UpdateCountdown));
					return;
				}

				if (!Program.isTrialMode || firebaseExpiry == null)
				{
					Program.lblCountdown1.Text = string.Empty;
					return;
				}

				DateTime expiryLocal = firebaseExpiry.Value.ToLocalTime();
				TimeSpan remaining = expiryLocal - DateTime.Now;

				if (remaining.TotalSeconds > 0)
				{
					int days = Math.Max(0, remaining.Days);
					int hours = Math.Max(0, remaining.Hours);
					int minutes = Math.Max(0, remaining.Minutes);
					int seconds = Math.Max(0, remaining.Seconds);

					Program.lblCountdown1.Text = $"ทดลองฟรี เหลืออีก {days} วัน {hours} ชั่วโมง {minutes} นาที {seconds} วินาที";
					Program.lblCountdown.ForeColor = Color.DarkGreen;
				}
                else
				{
					if (Program.expiryDialogShown)
					{
						return;
					}
					Program.countdownTimer.Stop();
					Program.lblCountdown1.Text = "หมดเวลาแล้ว";
					Program.lblCountdown.ForeColor = Color.Red;
					ShowExpiryDialogWithCountdown();

				}
			}
		}

