		private static void SaveCurrentModeSequence()
		{
			var clone = Program.CloneActionSequence(Program.actionSequence);
			switch (Program.currentShootingMode)
			{
			case "AutoShoot":
				Program.autoShootSequence = clone;
				return;
			case "SniperNoScope":
				Program.shotgunSequence = clone;
				return;
			case "SniperScope":
				Program.sniperScopeSequence = clone;
				return;
			default:
				return;
			}
		}

		private static List<ActionItem> CloneActionSequence(List<ActionItem> source)
		{
			if (source == null || source.Count == 0)
			{
				return new List<ActionItem>();
			}
			return source.Select(a => new ActionItem
			{
				Type = a.Type,
				Value = a.Value,
				DelayMs = a.DelayMs,
				ModeType = a.ModeType
			}).ToList();
		}

