		private static List<ActionItem> GetSequenceForMode(string mode)
		{
			switch (mode)
			{
			case "AutoShoot":
				if (Program.autoShootSequence == null || Program.autoShootSequence.Count == 0)
				{
					Program.autoShootSequence = Program.CreateDefaultAutoShootSequence();
				}
				return Program.autoShootSequence;
			case "SniperNoScope":
				if (Program.shotgunSequence == null || Program.shotgunSequence.Count == 0)
				{
					Program.shotgunSequence = Program.CreateDefaultShotgunSequence();
				}
				return Program.shotgunSequence;
			case "SniperScope":
				if (Program.sniperScopeSequence == null || Program.sniperScopeSequence.Count == 0)
				{
					Program.sniperScopeSequence = Program.CreateDefaultSniperScopeSequence();
				}
				return Program.sniperScopeSequence;
			default:
				return Program.actionSequence ?? new List<ActionItem>();
			}
		}

		private static void SwitchShootingMode(string newMode, bool persistSetting)
		{
			if (string.IsNullOrWhiteSpace(newMode))
			{
				return;
			}
			Program.SaveCurrentModeSequence();
			Program.currentShootingMode = newMode;
			Program.actionSequence = Program.CloneActionSequence(Program.GetSequenceForMode(newMode));
			Program.UpdateStatusDisplay();
			if (persistSetting)
			{
				Program.SaveSettings();
			}
		}

		private static void CycleShootingMode()
		{
			string[] order = new string[]
			{
				"AutoShoot",
				"SniperNoScope",
				"SniperScope"
			};
			int idx = Array.IndexOf(order, Program.currentShootingMode);
			int next = (idx + 1) % order.Length;
			Program.SwitchShootingMode(order[next], true);
		}

