		private static void HandleAdvancedButton()
		{
			if (Program.mainForm == null || Program.mainForm.IsDisposed)
			{
				return;
			}
			if (Program.IsDevBuild() || Program.VerifyAdvancedPassword())
			{
				Program.ShowAdvancedDialog();
			}
		}

		private static bool IsDevBuild()
		{
			try
			{
				string title = Program.mainForm?.Text ?? string.Empty;
				string status = Program.lblCountdown?.Text ?? string.Empty;
				string status2 = Program.lblCountdown1?.Text ?? string.Empty;
				return title.IndexOf("(DEV)", StringComparison.OrdinalIgnoreCase) >= 0
					|| status.IndexOf("(DEV)", StringComparison.OrdinalIgnoreCase) >= 0
					|| status2.IndexOf("(DEV)", StringComparison.OrdinalIgnoreCase) >= 0;
			}
			catch
			{
				return false;
			}
		}

		private static bool VerifyAdvancedPassword()
		{
			string uuid = AuthCheck.GetMachineUUID() ?? string.Empty;
			string expectedPassword = string.Format("{0}-{1}", uuid, DateTime.Now.Day);
			if (string.IsNullOrWhiteSpace(uuid))
			{
				MessageBox.Show("ไม่พบ UUID ของเครื่องนี้", "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
				return false;
			}
			bool allowed = false;
			using (Form prompt = new Form())
			{
				prompt.Text = "ป้อนรหัส Advance";
				prompt.FormBorderStyle = FormBorderStyle.FixedDialog;
				prompt.StartPosition = FormStartPosition.CenterParent;
				prompt.Size = new Size(360, 180);
				prompt.MaximizeBox = false;
				prompt.MinimizeBox = false;
				Label lbl = new Label
				{
					Text = "รหัสผ่าน:",
					AutoSize = true,
					ForeColor = Color.Black,
					Location = new Point(20, 20)
				};
				TextBox txt = new TextBox
				{
					Location = new Point(20, 50),
					Width = 300,
					UseSystemPasswordChar = true
				};
				Button btnOk = new Button
				{
					Text = "ตกลง",
					DialogResult = DialogResult.None,
					Location = new Point(20, 90),
					Width = 140
				};
				Button btnCancel = new Button
				{
					Text = "ยกเลิก",
					DialogResult = DialogResult.Cancel,
					Location = new Point(180, 90),
					Width = 140
				};
				btnOk.Click += (s, e) =>
				{
					string input = txt.Text.Trim();
					if (string.Equals(input, expectedPassword, StringComparison.OrdinalIgnoreCase))
					{
						allowed = true;
						prompt.DialogResult = DialogResult.OK;
						prompt.Close();
						return;
					}
					MessageBox.Show("รหัสผ่านไม่ถูกต้อง", "Access Denied", MessageBoxButtons.OK, MessageBoxIcon.Error);
				};
				prompt.Controls.Add(lbl);
				prompt.Controls.Add(txt);
				prompt.Controls.Add(btnOk);
				prompt.Controls.Add(btnCancel);
				prompt.AcceptButton = btnOk;
				prompt.CancelButton = btnCancel;
				prompt.ShowDialog(Program.mainForm);
			}
			return allowed;
		}

