		private static bool IsShotgunOverrideActive()
		{
			// ทำงานเฉพาะเมื่อเลือกโหมดสลับ เปิด/ปิด และกำลังเปิดอยู่
			if (!Program.toggleMode || !Program.isToggledOn)
			{
				return false;
			}

			if (!string.Equals(Program.currentShootingMode, "SniperScope", StringComparison.OrdinalIgnoreCase))
			{
				return false;
			}
			// เปลี่ยนเป็นคลิกขวาค้าง หรือเมาส์ข้างตัวที่หนึ่ง
			if (((int)Program.GetAsyncKeyState(2) & 32768) != 0) // Right button
			{
				return true;
			}
			if (((int)Program.GetAsyncKeyState(5) & 32768) != 0) // XBUTTON1
			{
				return true;
			}
			return false;
		}

