		private static bool DetectRedPixelBgr(Bitmap image)
		{
			if (image == null)
			{
				return false;
			}
			bool result;
			try
			{
				int centerX = Math.Max(0, Math.Min(image.Width - 1, image.Width / 2));
				int centerY = Math.Max(0, Math.Min(image.Height - 1, image.Height / 2));
				Color centerPixel = image.GetPixel(centerX, centerY);
				Program.sampledR = centerPixel.R;
				Program.sampledG = centerPixel.G;
				Program.sampledB = centerPixel.B;
				for (int y = 0; y < image.Height; y++)
				{
					for (int x = 0; x < image.Width; x++)
					{
						Color pixel = image.GetPixel(x, y);
						if ((int)pixel.B <= Program.blueThreshold && (int)pixel.G <= Program.greenThreshold && (int)pixel.R >= Program.redThreshold)
						{
							Program.sampledR = pixel.R;
							Program.sampledG = pixel.G;
							Program.sampledB = pixel.B;
							return true;
						}
					}
				}
				result = false;
			}
			catch (Exception)
			{
				result = false;
			}
			return result;
		}

		private static void SampleLatestColorForPreview()
		{
			try
			{
				int sampleX = Screen.PrimaryScreen.Bounds.Width / 2;
				int sampleY = Screen.PrimaryScreen.Bounds.Height / 2;
				IntPtr hwnd = Program.FindGameWindow();
				if (hwnd != IntPtr.Zero)
				{
					Rectangle win = Program.GetWindowRect(hwnd);
					if (win != Rectangle.Empty && Program.customRegion.Width > 0 && Program.customRegion.Height > 0)
					{
						sampleX = win.Left + Program.customRegion.X + Program.customRegion.Width / 2;
						sampleY = win.Top + Program.customRegion.Y + Program.customRegion.Height / 2;
					}
				}
				using (Bitmap bmp = new Bitmap(1, 1))
				{
					using (Graphics g = Graphics.FromImage(bmp))
					{
						g.CopyFromScreen(sampleX, sampleY, 0, 0, new Size(1, 1));
					}
					Color c = bmp.GetPixel(0, 0);
					Program.sampledR = c.R;
					Program.sampledG = c.G;
					Program.sampledB = c.B;
				}
			}
			catch
			{
				Program.sampledR = 0;
				Program.sampledG = 0;
				Program.sampledB = 0;
			}
		}

