		private class TransparentPanel : Panel
		{
			public TransparentPanel()
			{
				SetStyle(ControlStyles.SupportsTransparentBackColor, true);
			}

			protected override void OnPaintBackground(PaintEventArgs e)
			{
				if (BackColor.A > 0)
				{
					using (Brush brush = new SolidBrush(BackColor))
					{
						e.Graphics.FillRectangle(brush, ClientRectangle);
					}
					return;
				}
				base.OnPaintBackground(e);
			}
		}

		private static string Decode(string base64)
		{
			// ถอดรหัส Base64 → string (ลดการโผล่ของ literal ใน metadata; เมื่อผ่าน ConfuserEx constants จะถูกเข้ารหัสอีก)
			byte[] data = Convert.FromBase64String(base64);
			return Encoding.UTF8.GetString(data);
		}

		private static string BuildFirebaseCustomerUrl(string uuid)
		{
			string baseUrl = FirebaseDbUrl.TrimEnd('/');
			string path = "/customers/" + Uri.EscapeDataString(uuid) + ".json";
			if (!string.IsNullOrWhiteSpace(FirebaseAuthToken) && !FirebaseAuthToken.Contains("YOUR_DB_AUTH_TOKEN"))
			{
				return baseUrl + path + "?auth=" + FirebaseAuthToken;
			}
			return baseUrl + path;
		}

		private static async Task<CustomerRecord> FetchOrCreateCustomerAsync(string uuid)
		{
			if (string.IsNullOrWhiteSpace(FirebaseDbUrl) || FirebaseDbUrl.Contains("your-project-id"))
			{
				throw new InvalidOperationException("FirebaseDbUrl ไม่ถูกตั้งค่า");
			}

			string url = BuildFirebaseCustomerUrl(uuid);

			using (var client = new HttpClient())
			{
				// ดึงข้อมูลลูกค้า
				try
				{
					var response = await client.GetAsync(url).ConfigureAwait(false);
					if (response.IsSuccessStatusCode)
					{
						string body = await response.Content.ReadAsStringAsync().ConfigureAwait(false);
						if (!string.IsNullOrWhiteSpace(body) && body.Trim() != "null")
						{
							return JsonSerializer.Deserialize<CustomerRecord>(body, jsonOptions);
						}
					}
				}
				catch (Exception ex)
				{
					Debug.WriteLine("Firebase GET failed: " + ex.Message);
				}

				// ไม่พบ → สร้าง trial ใหม่ 5 วัน
				var thaiTimeZone = TimeZoneInfo.FindSystemTimeZoneById("SE Asia Standard Time"); // Bangkok UTC+7
				DateTime thaiNow = TimeZoneInfo.ConvertTimeFromUtc(DateTime.UtcNow, thaiTimeZone);
				DateTime thaiExpiry = thaiNow.AddDays(5);

				var newCustomer = new CustomerRecord
				{
					name = "ผู้ใช้ทดสอบ",
					plan = "free",
					status = true,
					program = "redtarget",
					createdAt = thaiNow.ToString("yyyy-MM-ddTHH:mm:sszzz", CultureInfo.InvariantCulture),
					expiry = thaiExpiry.ToString("yyyy-MM-ddTHH:mm:sszzz", CultureInfo.InvariantCulture)
				};

				string payload = JsonSerializer.Serialize(newCustomer, jsonOptions);
				var content = new StringContent(payload, Encoding.UTF8, "application/json");
				var putResponse = await client.PutAsync(url, content).ConfigureAwait(false);
				if (!putResponse.IsSuccessStatusCode)
				{
					throw new InvalidOperationException("Firebase PUT failed: " + putResponse.StatusCode);
				}

				return newCustomer;
			}
		}

		private class CustomerRecord
		{
			public string name { get; set; }
			public string plan { get; set; }
			public bool status { get; set; }
			public string program { get; set; }
			public string expiry { get; set; }
			public string createdAt { get; set; }
		}

